	add("anecdote", "{\"term\":\"anecdote\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"Late 17th century, from French \u0027anecdote\u0027 from Ancient greek (to 1453) \u0027ἀνέκδοτος\u0027 (accounts unpublished) from \u0027ἀν-\u0027 (not, un-) + \u0027ἔκδοτος\u0027 (published) from \u0027ἐκδίδωμι\u0027 (i publish) from \u0027ἐκ-\u0027 (out) + \u0027δίδωμι\u0027 (i give) Virtually identical cognates in other European languages – French \u0027anecdote\u0027 German \u0027anekdote\u0027 Spanish \u0027anécdota\u0027 among others.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short account of a real incident or person, often humorous or interesting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An account which supports an argument, but which is not supported by scientific or statistical analysis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A previously untold secret account of an incident\", \"priority\":3}]}, \"synonyms\":{}}");

	add("anecdoton", "{\"term\":\"anecdoton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1823\u0027\u0027: Daniel Waterland, \u0027The Works of the Rev. Daniel Waterland\u0027, [http://books.google.co.uk/books?id\u003dU50NAAAAQAAJ\u0026amp;pg\u003dPA170\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA page 170] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003deV8XAAAAYAAJ\u0026amp;pg\u003dPA170\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA 〃]\u0026lt;/sup\u0026gt; (also in works from: [http://books.google.co.uk/books?id\u003dpCYQAAAAYAAJ\u0026amp;pg\u003dPA139\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA \u0027\u00271843\u0027\u0027], [http://books.google.co.uk/books?id\u003dxMwHAAAAQAAJ\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA \u0027\u00271850\u0027\u0027], [http://books.google.co.uk/books?id\u003dlmoarVK_woQC\u0026amp;pg\u003dPA139\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA \u0027\u00271856\u0027\u0027], [http://books.google.co.uk/books?id\u003dmEsGbvGJibMC\u0026amp;pg\u003dPA51\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA \u0027\u00272008\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"9. There is another, in the library of St. German de Prez, about 500 years old. Montfaucon, having met with it, published it\u0026lt;sup\u0026gt;1\u0026lt;/sup\u0026gt; as an \u0027\u0027\u0027anecdoton\u0027\u0027;\u0027 not knowing that it was Bruno’s comment. It is not indeed quite so \u0027full\u0027, nor any thing near so \u0027correct\u0027 as the printed copies : but still it is plainly Bruno’s comment. The title, Tractatus de Fide Catholica\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027: \u0027The Academy\u0027, № 2, [http://books.google.co.uk/books?id\u003dQoMNAAAAQAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 356] (J. Murray\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"While on the subject of Olympiodorus, we have a brief word to say in connection with his Scholium on 474 A, which Dr. Thompson conceives to contain an \u0027\u0027anecdoton\u0027\u0027 from Heraclitus\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027: \u0027The Expositor\u0027, series 5: volume 1, [http://books.google.co.uk/books?id\u003diT42AAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 424] (Hodder and Stoughton\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"strictly speaking, an \u0027\u0027anecdoton\u0027\u0027 : the greater part of Jerome’s Notes on the Psalter has long been accessible in the \u0027Breviarium in Psalmos\u0027 which appears among his printed works\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027: \u0027Texts and Studies: Contributions to Biblical and Patristic Literature\u0027, volume 5 (1897–1899), [http://books.google.co.uk/books?id\u003ddT8idFc3DqMC\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page xlv] (also: [http://books.google.co.uk/books?id\u003dEcTiXLiif1MC\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 \u0027\u00271967\u0027\u0027] \u0026amp;: [http://books.google.co.uk/books?id\u003d9Dmv4Q3dg5oC\u0026amp;pg\u003dRA1-PR45\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA], [http://books.google.co.uk/books?id\u003dfAc4AAAAIAAJ\u0026amp;pg\u003dPR45\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;I publish\u0026lt;/span\u0026gt; here, as elsewhere in this volume, what is not exactly an \u0027\u0027\u0027anecdoton\u0027\u0027\u0027, but a more original form of a writing already known\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027: James Hastings, Ann Wilson Hastings, and Edward Hastings, \u0027The Expository Times\u0027, volume 11 (October 1899 – September 1900), [http://books.google.co.uk/books?id\u003dB7kAAAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 82] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003drAwpAAAAYAAJ\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA 〃]\u0026lt;/sup\u0026gt; (T. \u0026amp; T. Clark\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The publication has not the stirring interest of an \u0027\u0027anecdoton\u0027\u0027, especially an \u0027\u0027anecdoton\u0027\u0027 like that of the Sinai-Palimpsest or the Hebrew Original of Sirach, but it has a threefold importance — linguistical, biblical, and ecclesiastical\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027: \u0027Journal of Theological Studies\u0027, volume 5 (1903–1904), [http://books.google.co.uk/books?id\u003dVPsLAAAAIAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 218] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003dSDtKAAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 〃]\u0026lt;/sup\u0026gt; (Macmillan\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"But inasmuch as my own text was in type before I knew that I had been anticipated in the discovery, and seeing also that the document is one which from its age and character deserves all the attention which students can bestow upon it, I have ventured, with Dr. Mercati’s full consent, to publish the treatise, although no longer an \u0027\u0027\u0027anecdoton\u0027\u0027\u0027, in the pages of the \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Journal\u0026lt;/span\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027: J.-M. de Buck of Bibliothèque Royale de Beligique Brussels and Philip Edward Hallett (translator), \u0027Spiritual Exercises and Devotions of Blessed Robert Southwell, S.J.\u0027, [http://books.google.co.uk/books?id\u003dmU8AAAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page \u0027\u0027?\u0027\u0027] (Sheed \u0026amp; Ward\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The Brussels MS. is certainly an \u0027\u0027\u0027anecdoton\u0027\u0027\u0027. A few passages have been used, quite \u0027en passant\u0027, by historians of the English Martyrs who could not afford the leisure to do any more or perhaps never had access to the full text and had to be content\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027: Ben Edwin Perry, \u0027Secundus, the Silent Philosopher: The Greek Life of Secundus, Critically Edited and Restored So Far as Possible, Together with Translations of the Greek and Oriental Versions, the Latin and Oriental Texts, and a Study of the Tradition\u0027, [http://books.google.co.uk/books?id\u003d9_5cAAAAIAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page vii] (American Philological Association\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"He had printed the first half of the biography as an \u0027\u0027anecdoton\u0027\u0027, omitted the questions which followed, because they had previously been edited by Holstenius, and fused the final paragraph of the biography with the paragraph which precedes\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027: Balasundara Gupta of the British Academy, \u0027Proceedings of the British Academy\u0027, volume 25 (1939), [http://books.google.co.uk/books?id\u003dWh1ZAAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 318] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003do3KgAAAAMAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 〃]\u0026lt;/sup\u0026gt; (G. Cumberlege, Oxford University Press\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Mention should also be made of the important edition of Bale’s \u0027Index Britanniae Scriptorum\u0027, in which the late Miss Mary Bateson was his collaborator, and which appeared as an \u0027\u0027Anecdoton\u0027\u0027 Oxoniense in 1902\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027: Clifford Truesdell, \u0027Archive for History of Exact Sciences\u0027, volume 34, [http://books.google.co.uk/books?id\u003dw1U5AAAAIAAJ\u0026amp;q\u003d%22an+anecdoton%22\u0026amp;dq\u003d%22an+anecdoton%22\u0026amp;ei\u003d-H5VSdmgLqKIyASO3KDTBA\u0026amp;pgis\u003d1 page 30] (Springer-Verlag\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Bernoulli\u0026lt;/span\u0026gt; first discussed the problem in an “\u0027\u0027Anecdoton\u0027\u0027” written sometime after he had seen \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Taylor’s\u0026lt;/span\u0026gt; Methodus but not published until 1742\", \"priority\":20}]}, \"synonyms\":{}}");

	add("anecdotum", "{\"term\":\"anecdotum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Back-formation from \u0027anecdota\u0027 reinterpreting the nominative neuter plural case ending \u0027-a\u0027 as a Latin case ending (singular: \u0027-um\u0027 , rather than (as is etymologically-consistent) as an Ancient greek (to 1453) case ending (singular: \u0027-on\u0027 from \u0027sc\u003dpolytonic\u0027 ; perhaps reinforced by Latin \u0027anecdotum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, Friedrich Adolf Ebert and Arthur Browne, \u0027A General Bibliographical Dictionary\u0027, entry 8,304, [http://books.google.co.uk/books?id\u003dpzgLAAAAQAAJ\u0026amp;pg\u003dPA633\u0026amp;dq\u003d%22an+anecdotum%22\u0026amp;lr\u003d\u0026amp;ei\u003dQZ1VSeOlJIW6yQSfovzVBA page 633\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ang. Mai published it anew by mistake as an \u0027\u0027\u0027anecdotum\u0027\u0027\u0027, under the title, \u0027Philonis Judæi de virtute ejusque partibus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, David Roy Shackleton Bailey, \u0027Cicero’s Letters to Atticus\u0027, 371 (xiv. 17) — \u0027Pompeii, 3 May 44\u0027 — cicero to atticus: ¶ 6, [http://books.google.co.uk/books?id\u003dL5VpAAAAMAAJ\u0026amp;q\u003d%22that+anecdotum%22\u0026amp;dq\u003d%22that+anecdotum%22\u0026amp;lr\u003d\u0026amp;ei\u003dGqFVSfGeOZPqyQTQ45HADw\u0026amp;pgis\u003d1 page 49] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003dBzJsGtpNTwMC\u0026amp;pg\u003dPA49\u0026amp;dq\u003d%22that+anecdotum%22\u0026amp;lr\u003d\u0026amp;ei\u003dGqFVSfGeOZPqyQTQ45HADw 〃]\u0026lt;/sup\u0026gt; (University Press\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I have not yet quite polished that \u0027\u0027\u0027anecdotum\u0027\u0027\u0027 of mine to my satisfaction\", \"priority\":4}]}, \"synonyms\":{}}");

